// Components
import LoginContainer from "./login/LoginContainer.react.js";
import Navbar from 'react-bootstrap/Navbar';


// css
import "./App.css";

// React
import React, { useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";

// Backend
import { getHelloWorldMessageService } from "./services/HelloWorldServices";


function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );

  // const handleButtonClick = () => {
  //   getHelloWorldMessageService()
  //     .then((response) => {
  //       response.json().then((data) => {
  //         console.log(data);
  //       });
  //     })
  //     .catch((error) => {
  //       console.log(error);
  //     });
  // };
  // return (
  //   <div className="App">
  //     <LoginContainer />
  //     <button onClick={handleButtonClick}>click to connect to backend </button>
  //   </div>
  // );
}

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}

export default App;
